import React, { Component,useEffect } from 'react';
import './contactcut.css';
import Aos from 'aos';
import Img from './contact1.jpg';

const ContactCut = () => {

    return (
        
    	<div>
           <div className='parallx' 
            style={{backgroundImage:'url(' + Img + ')',height:'auto',maxWidth:'100%'}}>
            <div className='ovrly'>
                <div style={{zIndex:2}}>
                  <h1 className='head1' style={{padding:40,fontFamily:'B612 Mono'}}>CONTACT</h1>
                  <h3 className='head2' style={{color:'white',marginTop:-37,fontFamily:'B612 Mono'}}>GET IN TOUCH</h3>
                     <div className='container'>
             
                </div>    
            </div>
            </div>
            </div>
            
        </div>
    );
}

export default ContactCut;
